import React, { useState } from "react";
import Tabla from "./Tabla";
const TodasLasTablas = (props) => {
    const numeros = [2, 3, 4, 5, 6, 7, 8, 9, 10]
    return (
        <>
            <div>
                <h1>Tablas: </h1>
                <div className="grid">
                    {
                        numeros.map((num) => {
                            return (
                                <div><Tabla tabla={num} /> </div>
                            );
                        })
                    }
                </div>
            </div>

        </>
    );
};
export default TodasLasTablas;
